import React, { useEffect, useState } from 'react';
import { api } from '../../shared/api/todos';

export const Selected: React.FC = () => {
    const [completedTodos, setCompletedTodos] = useState<any[]>([]);

    const fetchCompletedTodos = async () => {
        try {
            const response = await api.getCompleted(); // Предполагается, что вы добавили этот метод в api
            setCompletedTodos(response);
        } catch (error) {
            console.error('Ошибка при получении выполненных задач:', error);
        }
    };

    useEffect(() => {
        fetchCompletedTodos();
    }, []);

    return (
        <div>
            <h1>Выполненные задачи</h1>
            {completedTodos.length > 0 ? (
                completedTodos.map((todo) => (
                    <div key={todo.id}>
                        <h2>{todo.title}</h2>
                        <p>Статус: {todo.completed ? 'Выполнено' : 'Не выполнено'}</p>
                    </div>
                ))
            ) : (
                <p>Нет выполненных задач.</p>
            )}
        </div>
    );
};
